/*
<div class="col-sm-6">
      <h3>Input</h3>
      <form class="form-inline" action="#">
      <input type="text" class="form-control" name="get-url" required/>
      <button class="btn btn-primary">Submit</button>
      </form>
    </div>
*/

import React, { Component } from 'react';

class Leftside extends Component {
	constructor(props) {
		super(props);
	}

	render() {
		const elements = (<div class="col-sm-6">
				<h3>Input</h3>
				<form class="form-inline" action="#">
					<input type="text" class="form-control" name="get-url" required/>
					<button class="btn btn-primary">Submit</button>
				</form>
			</div>);
		return elements;
	}
}

export default Leftside;
